useEffect(() => {
    console.log("Base URL:", process.env.REACT_APP_API_URL);
    async function fetchProducts() {
        try {
            const { data } = await axios.get(`${process.env.REACT_APP_API_URL}/products/`);
            setProducts(data);
        } catch (error) {
            console.error('Error fetching products:', error);
        }
    }
    fetchProducts();
}, []);
